(1, 'Data Protection Policy Heading', '<span xss=removed>Data Protection Policy Description</span>', 'DataProtectionPolicy', '04/17/2020'),
(2, 'Privacy Policy ', '<div>Advertising Limitations</div><div><br></div><div>1. The positioning and placement of an Advertisement and listing is at the discretion of indbiz™ except where expressly agreed in writing by indbiz™. indbiz™ will attempt to position Advertisements, in accordance with the Advertiser’s request if the Advertiser has agreed to pay any relevant preferred position loading charges.</div><div><br></div><div>2. Every Advertisement submitted for the Apps is subject to indbiz™’s approval. indbiz may at its absolute discretion at any time:</div><div>        2.1<span xss=\"removed\"> </span>Refuse to publish any advertisement without giving any reason (in which case, no charge to Advertiser will be incurred);</div><div>        2.2<span xss=\"removed\"> </span>Cancel a campaign or promotion (in which case, no charge to Advertiser will be incurred for the unpublished portion of the campaign);</div><div><br></div><div>3. Indbiz™ owes no duty to Advertiser to review, approve or amend any Advertisement and no review, approval or amendment by Indbiz will      aﬀect Advertiser’s responsibility for the content of the Advertisement.</div><div><br></div><div>4. Indbiz™ may, but is not obliged to, under pressure of deadline and without prior consultation or notice to Advertiser, amend any   Advertisement in any terms whatsoever, if indbiz™ perceives it to be:</div><div>        4.1<span xss=\"removed\"> </span>In breach of any law of Australia or of any state (whether civil or criminal);</div><div>        4.2<span xss=\"removed\"> </span>In breach of any pre-existing publishing agreement entered into by Indbiz;</div><div>        4.3<span xss=\"removed\"> </span>Defamatory;</div><div>        4.4<span xss=\"removed\"> </span>In contempt of court or parliament;</div><div>        4.5<span xss=\"removed\"> </span>Otherwise likely to attract legal proceedings of any kind; and</div><div>        4.6<span xss=\"removed\"> </span>Oﬀensive.</div><div><br></div><div>5. Indbiz™ owns and retains all copyright and other intellectual property rights in relation to any Advertisements produced by indbiz™ or any materials provided by indbiz™ for use in an Advertisement.</div><div> </div><div>Use of this Application</div><div><br></div><div>6. Indbiz Media Pty Ltd (indbiz™) is the owner and operator of this App.</div><div><br></div><div>7. Users of this App (Users) agree to be bound by these Terms & Conditions. Your use of and access to this App indicates your  acceptance of these Terms & Conditions, as they exist at the time of use.</div><div><br></div><div>8. Indbiz™ may amend these terms and conditions at any time by posting changes on the App.  If you use the App (other than to review the amended terms) after a notice of change has been provided, you will be deemed to have accepted the new terms and conditions.</div><div> </div><div>Intellectual Property</div><div><br></div><div>9. All intellectual property in relation to content on this App belongs to indbiz™ or its licensors, advertisers or aﬃliates. You obtain no interest in that intellectual property. All content on this App is protected by Australian and international copyright and other intellectual property laws. You may not do anything which interferes with or breaches those laws or the intellectual property rights in the content.</div><div><br></div><div>10. You may download and view content or print a copy of material on this App for personal, non-commercial use provided you do not modify the content in any way (including any copyright notice). All rights not expressly granted under these terms of use are reserved by Indbiz™.  Unless expressly stated otherwise, you are not permitted to copy, or republish anything you ﬁnd on the App without the copyright or trademark owners’ permission.</div><div><br></div><div>11. The logos of the App are trademarks of indbiz™ or its related bodies corporate. Other trademarks may be displayed on the App from time to time. These may belong to third parties. Nothing displayed on the App should be construed as granting any licence or right of use of any logo, trademark or masthead displayed on the App, without the express written permission of the relevant owner.</div><div> </div><div>Liability & Indemnity</div><div><br></div><div>12. Indbiz™ does not exclude any rights and remedies in respect of goods or services under the Australian Consumer Law in the Competition and Consumer Act 2010 (ACL) which cannot be excluded, restricted or modiﬁed.  However, indbiz™ excludes all rights, remedies, guarantees, conditions and warranties in respect of goods or services from your use of the App whether based in statute, common law or otherwise to the extent permitted by law. To the fullest extent possible and subject to indbiz™ liabilities and obligations under the ACL:</div><div>           12.1 Indbiz™ does not warrant the accuracy of the content which you access through this App. The content is provided to you “as is” and on an “as available” basis and on the condition that you undertake all responsibility for assessing the accuracy of the content and rely on it at your own risk. All content which you access through this App may be changed at indbiz™ sole  discretion and without notice;</div><div>           12.2 Indbiz™ will have no responsibility or liability in relation to any loss or damage that you incur, including damage to your software or hardware, arising from your use of or access to this App;</div><div>           12.3 Indbiz™ does not warrant that functions of this App or which you access through this App, such as hyperlinks, will be uninterrupted or error free, that defects will be corrected or that indbiz™ or the server that makes it available, are free of viruses or bugs; and</div><div>           12.4 You indemnify indbiz™ and its aﬃliated companies, and each of their directors, oﬃcers, employees and agents against any action, claim, loss or expense which it incurs which arises from your use of this App.</div><div><br></div><div>Third Party Content & Links</div><div><br></div><div>13. This App may include third party content which is subject to that third party’s terms and conditions of use. Nothing on this App should be construed as granting any licence or right for you to use that content.</div><div><br></div><div>14. This App may include links to third party sites which are not related to indbiz™ and in relation to which indbiz™ has no control or interest. The appearance of those links on this App does not indicate any relationship between Indbiz™ and that third party or any endorsement by indbiz™ of that third party, its site or the products or services which it is advertising on this App.</div><div> </div><div>Privacy</div><div><br></div><div>15. Indbiz™ collects personal information about Advertiser, including for example Advertiser’s name and contact details which you provide when registering or using our services.</div><div><br></div><div>Irrevocable Rights</div><div><br></div><div>16. When you submit content to indbiz™ in any format, including any text, photographs, graphics, video or audio, you grant indbiz™ a non-exclusive, royalty-free, perpetual licence to publish, transmit or otherwise use that content in any way, now and in the future.</div><div><br></div><div>17. Indbiz™ reserves the right not to use the content you submit.</div><div><br></div><div>18. You warrant that you have all of the necessary rights, including copyright, in the content you contribute, that your content is not defamatory and that it does not infringe any law.</div><div><br></div><div>19. You indemnify indbiz™ against any and all legal fees, damages and other expenses that may be incurred by indbiz™ as a result of a breach of the above warranty.</div><div><br></div><div>20. You waive any moral rights in your contribution for the purposes of its submission to and use by indbiz™ in accordance with these terms.</div><div> </div><div>Acknowledgement</div><div><br></div><div>21. Indbiz™ accepts no responsibility for the completeness or accuracy of any of the information contained on or accessed through  this  website  and  makes  no  representations about  its suitability for any particular purpose.</div><div><br></div><div>22. We make every eﬀort to ensure that the information on this app is accurate.</div><div><br></div><div>23. We make every eﬀort to ensure that links on this site are kept up-to-date. The currency of the links is dependent upon the owners of those sites letting us know of any changes. If you ﬁnd a link that does not work, please contact us by telephone or via the online feedback form.</div><div><br></div><div>24. Users will not use this App for any purposes or in any way which is unlawful.</div><div><br></div><div>25. The Terms and Conditions shall be governed by and interpreted in accordance with the laws of Queensland.</div><div><br></div><div>26. Indbiz™ is a trademark and is owned by Indbiz Media Pty Ltd A.C.N 622 988 68.</div>', 'PrivacyPolicy', '05/20/2020'),
(3, 'Disclaimers Heading', '<span xss=\"removed\">Disclaimers Description</span>', 'Disclaimers', '05/20/2020'),
(4, 'Indbiz Media Limited', '<p><span xss=\"removed\">INFORMATION ABOUT OUR USE OF COOKIES</span><br>Our website uses cookies to distinguish you from other users of our website. This helps us to provide you with a good experience when you browse our website and also allows us to improve our website. By continuing to browse the website, you are agreeing to our use of cookies. <br><br>A cookie is a small file of letters and numbers that we store on your browser or the hard drive of your computer if you agree. Cookies contain information that is transferred to your computer\'s hard drive. We use the following cookies: <br></p><ul xss=\"removed\"><li><span xss=\"removed\">Strictly necessary cookies.</span> These are cookies that are required for the operation of our website. They include, for example, cookies that enable you to log into secure areas of our website, use a shopping cart or make use of e-billing services.</li><li><span xss=\"removed\">Analytical/performance cookies.</span> They allow us to recognise and count the number of visitors and to see how visitors move around our website when they are using it. This helps us to improve the way our website works, for example, by ensuring that users are finding what they are looking for easily.</li><li><span xss=\"removed\">Functionality cookies.</span> These are used to recognise you when you return to our website. This enables us to personalise our content for you, greet you by name and remember your preferences (for example, your choice of language or region).</li><li><span xss=\"removed\">Targeting cookies.</span> These cookies record your visit to our website, the pages you have visited and the links you have followed. We will use this information to make our website and the advertising displayed on it more relevant to your interests. We may also share this information with third parties for this purpose.</li></ul><p></p><p>Please note that third parties (including, for example, advertising networks and providers of external services like web traffic analysis services) may also use cookies, over which we have no control. These cookies are likely to be analytical/performance cookies or targeting cookies.</p><p>You block cookies by activating the setting on your browser that allows you to refuse the setting of all or some cookies. However, if you use your browser settings to block all cookies (including essential cookies) you may not be able to access all or parts of our website.</p><p><span xss=\"removed\">Changes to our cookie policy</span><br>Any changes we may make to our cookie policy in the future will be posted on this page.</p><p><span xss=\"removed\">Contact</span><br>QUESTIONS, COMMENTS AND REQUESTS REGARDING THIS COOKIE POLICY ARE WELCOMED AND SHOULD BE ADDRESSED TO <a href=\"mailto:indbizaustralia@gmail.com\">indbizaustralia@gmail.com</a>.</p>', 'CookiePolicy', '05/20/2020'),
(5, 'About IndBiz', '<p class=\"MsoNormal\" xss=\"removed\"><span xss=\"removed\">A trustworthy and intelligent app,\r\nIndBiz has been created for people to quickly search for just the right Indian shops,\r\nbusinesses and services in all Australian states.</span></p>\r\n\r\n<p class=\"MsoNormal\" xss=\"removed\"><span xss=\"removed\">IndBiz lists all kinds on Indian\r\nbusinesses and services in Australia for convenient searches online. Users can quickly\r\nand reliably search for all types of trade professionals, such as electrician,\r\nplumber and carpenter, or professionals such as doctors, lawyers, etc., right\r\nfrom their mobiles or laptops.</span></p>\r\n\r\n<p class=\"MsoNormal\" xss=\"removed\"><span xss=\"removed\">Besides bringing the users\r\nregular updates on wide range of services and businesses, the app is also built\r\nto create, nurture and facilitate networking between Indian businesses and\r\nprofessionals across all Australia states. Moreover, businesses can also market\r\ntheir products and services through the platform for increased visibility and\r\nsales leads. <o></o></span></p>', 'About', '05/20/2020'),
(6, 'About', 'About', 'About', NULL),
(7, 'Terms & Conditions', '<h4>Terms & Conditions</h4>\r\n<br><br><br><br><br><br><br>', 'TermsAndConditions', '05/20/2020');
